import Link from 'next/link';

const Navbar = (props) => {
    return(
        <div>
            <ul>
                <li>
                <Link href={{ pathname: '/dashboard/55', }}><a>Dashboard</a></Link>
                </li>
            </ul>
            {props.children}
        </div>
    )
}

export default Navbar;
